import React from "react";

const jumbotronStyle = {
    paddingBottom: '150px',
    boxShadow: "0px 0px 0px 0px rgba(0,0,0,0)"
}

function Header () {
    return (
    <div>
        <nav>
            <div className="nav-wrapper">
                <a href="#" className="brand-logo">Clicky Game!</a>
                <ul id="nav-mobile" className="right hide-on-med-and-down">
                    <li>You Guessed Correctly</li>
                    <li>Score: 0 | Top Score: 0</li>
                </ul>
            </div>
        </nav>

        <div className="card-panel grey lighten-2 center" style={jumbotronStyle}>
            <div className="container">
                <h1>Clicky Game!</h1>
                <p>Click on an image to earn points, but don't click on any more than once! Or else...</p>
            </div>
        </div>
    </div>
    );
}

export default Header;
